INSERT INTO `zg_abcdata` VALUES ('34','0','33','煤炭行业','research.php','0','','11','0','煤炭行业知多少 　　北京诺美规划设计院是国内最具行业整合力和创意表现力的专业规划设计机构，致力于引领行业发展和领域创新。山合水易多年专注于休闲产品设计与度假项目规划，拥有强大的专家团队与产业链资源，具备多个领域的国家级规划设计资质，经过几年的跨越式发展，已经成为中国最有影响力规划设计品牌之一。 　　诺美以策划、规划、设计、多媒体及运营为核心业务。自2005年创办以来已经为30个省、市、自治区、直辖市，超过200多个县市及上百家企业提供了优质服务，累计完成数百个项目成果及专项研究报告，其中近三成项目还在持续跟进中，有超过50个项目已经建成投入运营。','0','','2','','','0','0','','0','','1','0','0')<{|}>
