INSERT INTO `zg_article` VALUES ('7','2','0','4','21','第一季度我国原油进口量增价跌','#000000','0','','0','行业新闻','原油进口量','诺美','中化新网','1397614225','ljd','0','0','0','0','0','0','','0','','','0','','','','','0','　　据海关统计，一季度我国进出口总值5.9万亿元，比去年同期下降3.7%。其中，出口3万亿元，下降6.1%；进口2.9万亿元，下降1.2%；一季度，主要大宗商品进口量增价跌。其中，原油进口7472.4万吨，增加8.3%，进口均价为每吨4817.1元，下跌4.7%；煤炭进口8396.4万吨，增加5.1%，进口均价为每吨493.7元，下跌14.2%。3月，我国外贸出口先导指数为41.7，较上月提升0.4，今年1～3月的平均指数为41.6，较去年第四季度的39.4有明显上升，预计二季度我国出口相对乐观。','[{"image":"","show":""}]','')<{|}>
