INSERT INTO `zg_article` VALUES ('13','2','0','2','13','诺美荣誉','#000000','0','','0','<span>诺美咨询认为，为了给客户提供高水准的咨询成果，咨询机构有责任整合优化一切可以利用的资源，在公平公正的框架上实现大咨询大产业。为此，诺美咨询在达华集团现有多个国家甲级咨询资质的基础上通过与中科院、航天院、社科院等一流院所、咨询集团建立起广泛的合作关系，同时与各大商会、财团、投资银行形成战略合作联盟，为项目规划咨询特别是有关城市规划、产业规划提供了强有力的资金容量及项目投资保障，让规划方案落地生根发芽、开花结果，避免伪规划对资源的严重浪费与伤害。目前诺美咨询拥有的国家甲、乙级咨询资质覆盖了工程咨询、招标代理、工程监理、城市规划、建筑设计、环境评价、安全评价、水土保持等多个专业领域，与国家多个部委有关部门进行密切交流与协作，客户遍及中国各大区域。<span><span><span><span></span></span></span></span></span><span id="__kindeditor_bookmark_start_5__"></span>','诺美荣誉','诺美咨询','诺美咨询','1398298084','nuomei','0','0','0','0','0','0','upload/2014-04/28/201404281532_3298.jpg','0','','','0','','诺美咨询','','','0','','[{"image":"","show":""}]','')<{|}>
